type Mode = 0 | 1;
type Status = -1 | 0 | 1;

interface Option {
  startValue?: number;
  endValue?: number;
  mode?: Mode;
}

export class GProgress {
  public rootDOM: HTMLElement | null = null;
  public containerDOM: HTMLDivElement | null = null;
  public startValue = 0;
  public endValue = 100;
  public mode: Mode = 0;
  private _eventMap: Map<string, Function[]> = new Map();
  private _percentDOM: HTMLDivElement | null = null;
  private _barDOM: HTMLDivElement | null = null;
  private _textDOM: HTMLDivElement | null = null;
  private _incTimer: NodeJS.Timer | null = null;
  private _countToTimer: NodeJS.Timer | null = null;
  public _bgImage = loadingImage;
  public get bgImage() {
    return this._bgImage;
  }
  public set bgImage(url: string) {
    if (this.containerDOM) {
      this.containerDOM.style.backgroundImage = `url(${url})`;
    }
  }
  private _status: Status = -1;
  public get status() {
    return this._status;
  }
  public set status(status: Status) {
    this._status = status;
    this.emit("changeStatus", status);
  }
  private _value = 0;
  public get value() {
    return this._value;
  }
  public set value(value: number) {
    this._value = value;
    if (this._percentDOM) {
      this._percentDOM.innerHTML = Math.round(value) + "%";
    }
    if (this._barDOM) {
      this._barDOM.style.width = value + "%";
    }
    this.emit("changeValue", value);
  }

  constructor(parent: string | HTMLElement) {
    if (typeof parent === "string") {
      this.rootDOM = document.getElementById(parent) as HTMLElement;
    } else {
      this.rootDOM = parent;
    }
  }

  show = () => {
    if (!this.rootDOM) {
      return;
    }
    this.rootDOM.style.position = "relative";
    if (!this.containerDOM) {
      const containerDOM = document.createElement("div");
      const wrapDOM = document.createElement("div");
      const percentDOM = document.createElement("div");
      const barWrapDOM = document.createElement("div");
      const barDOM = document.createElement("div");
      const textDOM = document.createElement("div");

      containerDOM.style.width = "100%";
      containerDOM.style.height = "100%";
      containerDOM.style.position = "absolute";
      containerDOM.style.left = "0";
      containerDOM.style.top = "0";
      containerDOM.style.backgroundImage = `url(${this.bgImage})`;
      containerDOM.style.backgroundColor = "#000";
      containerDOM.style.backgroundPosition = "center";
      containerDOM.style.backgroundSize = "cover";
      containerDOM.style.backgroundRepeat = "no-repeat";
      containerDOM.style.userSelect = "none";
      containerDOM.style.zIndex = "10000";
      containerDOM.style.transitionProperty = "all";
      containerDOM.style.transitionTimingFunction = "linear";

      wrapDOM.style.width = "100%";
      wrapDOM.style.position = "absolute";
      wrapDOM.style.left = "0";
      wrapDOM.style.bottom = "10%";
      wrapDOM.style.display = "flex";
      wrapDOM.style.flexDirection = "column";
      wrapDOM.style.justifyContent = "center";
      wrapDOM.style.alignItems = "center";

      percentDOM.style.height = "48px";
      percentDOM.style.lineHeight = "48px";
      percentDOM.style.fontSize = "40px";
      percentDOM.style.fontFamily = "PangMenZhengDao, PangMenZhengDao-3";
      percentDOM.style.color = "rgba(255,255,255,0.85)";
      percentDOM.style.marginBottom = "36px";

      barWrapDOM.style.width = "50%";
      barWrapDOM.style.backgroundColor = "rgba(255, 255, 255, 0.08)";

      barDOM.style.width = "0%";
      barDOM.style.borderTop = "2px solid";
      barDOM.style.borderBottom = "2px solid";
      barDOM.style.borderImage =
        "linear-gradient(270deg, #91d5ff, #1890ff 100%) 4 4";
      barDOM.style.boxShadow = "0px 0px 16px 0px #1890ff";

      textDOM.style.height = "22px";
      textDOM.style.lineHeight = "22px";
      textDOM.style.fontSize = "14px";
      textDOM.style.fontFamily = "PingFangSC, PingFangSC-Regular";
      textDOM.style.fontWeight = "400";
      textDOM.style.color = "rgba(255,255,255,0.65)";
      textDOM.style.marginTop = "20px";

      containerDOM.appendChild(wrapDOM);
      wrapDOM.appendChild(percentDOM);
      wrapDOM.appendChild(barWrapDOM);
      barWrapDOM.appendChild(barDOM);
      wrapDOM.appendChild(textDOM);

      this.containerDOM = containerDOM;
      this._percentDOM = percentDOM;
      this._barDOM = barDOM;
      this._textDOM = textDOM;
    }
    if (!this.rootDOM.contains(this.containerDOM)) {
      this.rootDOM.appendChild(this.containerDOM);
    }
    this.containerDOM.style.transitionDuration = "0";
    this.containerDOM.style.opacity = "1";
  };

  hide = (delay = 500) => {
    setTimeout(() => {
      if (this.containerDOM) {
        this.containerDOM.style.transitionDuration = "150ms";
        this.containerDOM.style.opacity = "0";
      }
      setTimeout(() => {
        if (
          this.rootDOM &&
          this.containerDOM &&
          this.rootDOM.contains(this.containerDOM)
        ) {
          this.rootDOM.removeChild(this.containerDOM);
        }
      }, 150);
    }, delay);
  };

  on = (name: string, handler: Function) => {
    const handlers = this._eventMap.get(name) || [];
    handlers.push(handler);
    this._eventMap.set(name, handlers);
  };

  off = (name: string, handler?: Function) => {
    let handlers = this._eventMap.get(name);
    if (handlers) {
      if (handler) {
        handlers = handlers.filter((h) => h !== handler);
      } else {
        handlers = [];
      }
      this._eventMap.set(name, handlers);
    }
  };

  private emit = (name: string, params: any) => {
    const handlers = this._eventMap.get(name);
    handlers?.forEach((handler) => handler(params));
  };

  set = (option: Option = {}) => {
    Object.keys(option).forEach((key) => {
      const _key = key as keyof Option;
      this[_key] = option[_key] as any;
    });
  };

  start = (text?: string) => {
    this.show();
    this.value = this.startValue;
    this.status = 1;
    this.update(this.startValue, text);
    this.emit("start", this.value);
  };

  update = (percent: number, text?: string, onEnd = () => {}) => {
    if (percent < this.startValue) {
      percent = this.startValue;
    }
    if (percent > this.endValue) {
      percent = this.endValue;
    }
    if (this._textDOM && typeof text === "string") {
      this._textDOM.innerHTML = text;
    }
    if (this._incTimer) {
      clearInterval(this._incTimer);
    }
    this._countTo(percent, () => {
      if (this.mode === 0 && this.status === 1) {
        this._inc();
      }
      onEnd();
      this.emit("update", this.value);
    });
  };

  done = (text?: string, delay?: number) => {
    this.status = 0;
    this.update(this.endValue, text, () => this.hide(delay));
  };

  private _inc = () => {
    if (this._incTimer) {
      clearInterval(this._incTimer);
    }
    this._incTimer = setInterval(() => {
      let amount = 0;
      const n1 = this.startValue + this.endValue * 0.5;
      const n2 = this.startValue + this.endValue * 0.7;
      const n3 = this.startValue + this.endValue * 0.85;
      const n4 = this.startValue + this.endValue * 0.95;
      const n5 = this.startValue + this.endValue * 0.994;
      if (this.value >= this.startValue && this.value < n1) {
        amount = this._random(5);
      } else if (this.value >= n1 && this.value < n2) {
        amount = this._random(2);
      } else if (this.value >= n2 && this.value < n3) {
        amount = this._random(1);
      } else if (this.value >= n3 && this.value < n4) {
        amount = this._random(0.5);
      } else if (this.value >= n4 && this.value < n5) {
        amount = this._random(0.1);
      }
      this._countTo(this.value + amount);
    }, 500);
  };

  private _countTo = (value: number, onEnd = () => {}) => {
    if (this._countToTimer) {
      clearInterval(this._countToTimer);
    }
    const diff = value - this.value;
    const step = diff / 10;
    let count = 0;
    const calc = () => {
      this.value += step;
      count++;
      if (count >= 10) {
        if (this._countToTimer) {
          clearInterval(this._countToTimer);
        }
        onEnd();
      }
    };
    this._countToTimer = setInterval(calc, 15);
    calc();
  };

  private _random = (max: number, min = 0) => {
    return Math.random() * (max - min) + min;
  };
}

const loadingImage =
  "data:image/jpeg;base64,";
